import React, {Component} from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';

class AboutPage extends Component {
  render(){
    return(
      <div>
        <Jumbotron className="lineargradientrainbow135">
          <h1>Who we are</h1>
        </Jumbotron>
      </div>
    );
  }
}

export default AboutPage;
